import React, { Fragment,useState } from "react";

function Registration(){
    const[name,setName]=useState("");
    const[surname,setSurname]=useState("");
    const[email,setEmail]=useState("");
    const[password,setPassword]=useState("");

    const handleNameChange= (value) =>{ setName(value)}
    const handleSurnameChange= (value) =>{ setSurname(value)}
    const handleEmailChange= (value) =>{ setEmail(value)}
    const handlePasswordChange= (value) =>{ setPassword(value)}


    return(
    <Fragment>
        <div>Registration</div>
        <label>Name</label>
        <input type="text" id="txtName" placeholder="Enter Name" onChange={(e)=> handleNameChange(e.target.value)}/><br></br>
        <label>Surname</label>
        <input type="text" id="txtSurname" placeholder="Enter Surname" onChange={(e)=> handleSurnameChange(e.target.value)}/><br></br>
        <label>Email</label>
        <input type="text" id="txtEmail" placeholder="Enter Email" onChange={(e)=> handleEmailChange(e.target.value)}/><br></br>
        <label>Password</label>
        <input type="text" id="txtPassword" placeholder="Enter Password" onChange={(e)=> handlePasswordChange(e.target.value)}/><br></br>
        <button>Save</button>
    </Fragment>
    
    )
}
export default Registration;
